    pub const fn expr_ident(&self) -> bool {
        matches!(self,
            Keyword::CURRENT_DATE
            | Keyword::CURRENT_TIME
            | Keyword::CURRENT_TIMESTAMP
            | Keyword::IF
            | Keyword::LOCALTIME
            | Keyword::LOCALTIMESTAMP
            | Keyword::REPLACE
            | Keyword::RIGHT
            | Keyword::UTC_DATE
            | Keyword::UTC_TIME
            | Keyword::UTC_TIMESTAMP
            | Keyword::VALUES
        ) || !self.reserved()
    }
